    # For Menu Total  
    def insert_data(self):
        data_name = self.lineEdit_3.text()
        data_price = self.lineEdit_5.text()
        data_quan = self.lineEdit_6.text()
        data_total = int(data_price) * int(data_quan)
        try:
           conn = sqlite3.connect('cyber_cafe.db')
           cursor = conn.cursor()
           sql = ('''INSERT INTO DATA(Name,Price,Quantity,Total) VALUES(?,?,?,?);''')
           cursor.execute(sql,(data_name,data_price,data_quan,str(data_total)))
           conn.commit()
           conn.close()
           # For Sub_total 
           self.lineEdit_3.setText("")
           self.lineEdit_5.setText("")
           self.lineEdit_6.setText("")
           self.load_datas()
           global total_order_value
           total_order_value=total_order_value+data_total                   
           self.lineEdit_7.setText(str(total_order_value))
           gst_Total = total_order_value + (total_order_value*17/100)        
           self.lineEdit_9.setText(str(gst_Total))
        except Exception as error:
           print(error)
        
    def load_datas(self):
        try:
            conn = sqlite3.connect('cyber_cafe.db')
            cursor = conn.cursor()
            sql=("SELECT * FROM DATA")
            result=cursor.execute(sql)
            self.tableWidget.setRowCount(0)
            for row_number, row_data in enumerate(result):
                self.tableWidget.insertRow(row_number)
                for column_number, data in enumerate(row_data):
                    self.tableWidget.setItem(row_number,column_number, QtWidgets.QTableWidgetItem(str(data)))
            conn.commit()
            conn.close()
        except Exception as error:
            print(error)
     
    # For Payment 
    def pay_data(self):
        data1_pay = self.lineEdit_14.text()
        data1_total = self.lineEdit_9.text()
        # sales work
        date = datetime.today().strftime("%d-%m-%Y")
        try:
            self.lineEdit_12.setText("")
            global total_order_value
            total_order_value = 0
            change = float(data1_pay) - float(data1_total)  ###hamesha .text se string number ayega means '6' minus '5'
            self.lineEdit_12.setText(str(change))
            # sales work
            conn = sqlite3.connect('cyber_cafe.db')
            cursor = conn.cursor()
            sql = ('''INSERT INTO SALES(Date,Amount) VALUES(?,?);''')
            cursor.execute(sql,(date,data1_total))
            conn.commit()
            conn.close()
            self.load_sales()
        except Exception as error:
            print(error)

