    def check_sales(self):
        check_date = self.dateEdit.date()
        try:
            date_format = check_date.toString('dd-MM-yyyy')
            conn = sqlite3.connect('cyber_cafe.db')
            cursor = conn.cursor()
            sql = 'SELECT Amount FROM SALES where Date=?;'
            cursor.execute(sql,(date_format,))
            row=cursor.fetchall()
            amount = 0
            if not row:
                msg = QMessageBox()
                msg.setIcon(QMessageBox.Critical)
                msg.setText("NO RECORD FOUND")
                msg.setWindowTitle("CYBER CAFE")
                msg.exec_()
                self.lineEdit_10.setText('')
            else:
                for data in row:
                    amount = amount + float(data[0])
                self.lineEdit_10.setText(str(amount))
        except Exception as error:
            print(error)
            
            
